import React from "react";
import "./Form.css";
import SignUpEmail from "./SignUpEmail";
export default class SignUpForm extends React.Component {
  constructor() {
    super();
    this.state = {
      submitButtonState: false,
    };
    this.isNormalEmail = this.isNormalEmail.bind(this);
  }
  isNormalEmail(result) {
    console.log(result);
    this.setState({ submitButtonState: result });
  }
  render() {
    return (
      <form>
        <label htmlFor="name">{"Имя:"}</label>
        <input id="name" type={"text"}></input>
        <label htmlFor="surname">{"Фамилия:"}</label>
        <input id="surname" type={"text"}></input>
        <label htmlFor="lastname">{"Отчество:"}</label>
        <input id="lastname" type={"text"}></input>
        <SignUpEmail func={this.isNormalEmail} />
        <button type={"submit"} disabled={this.state.submitButtonState}>
          {"Submit"}
        </button>
      </form>
    );
  }
}
